Обнимая Фрею
⠀
Я сидел и мечтательно гладил
Шерсть подруги моей с тоской...
А на ум приходили мысли:
Мертвый я или все же живой?
⠀
Как собаке немного нужно:
Вот от дерева тень, да я...
Тень от жары спасает ду́шной,
А рука моя гладит бока.
⠀
Почему же, душа, ты не рада,
Если солнце есть, есть трава?
Что на свете живая мама,
Что есть брат, а ещё сестра...
⠀
Счастье в том ли, чего не имеешь?
Или в том, что умеешь ценить?
Правда в том, что с любовью на сердце
Так легко и так радостно жить.
⠀
8 апреля 2020 года.
